/*
import { Outlet,Link } from "react-router-dom"

const ProductRouter = () => {

  return(
    <>
      <div>
        <nav>
          <ul>
            <Link to="/"></Link>
            <Link to='/:id'></Link>
          </ul>
        </nav>
      </div>
      <Outlet />
    </>
  )
}

export default ProductRouter;
